import React, {Component} from 'react';

class Counter extends Component {
    render() {
        const {counter, add, get} = this.props
        return (
            <div className="jumbotron">
                <h2>{counter}</h2>
                <button className="btn btn-primary btn-lg" onClick={add}>+</button>
                <button className="btn btn-primary btn-lg" onClick={get}>-</button>
            </div>
        );
    }
}

export default Counter;
